@coreygamble surprised every watch fanatic at Met Gala 2021 with a possibly unique @patekphilippe Grand Complication 5208-300P in platinum, salmon dial and baguette-cut diamonds bezel. This timepiece is one of the most complicated Patek Philippe ever made, in this exclusive configuration is nearly impossible to find. The 719-part movement, combining a minute repeater, a monopusher chronograph and an instantaneous perpetual calendar with aperture displays. The movement can be admired through a sapphire-crystal case back. #PatekPhilippe

Retail price: $ 1,270,000.00

Photo: @coreygamble | @patekphilippe

@pharrell on the red carpet at 2021 Met Gala was wearing an exclusive @richardmille RM 17-01 Tourbillon in 18k rose gold, full covered with baguette-cut diamonds. This watch is powered by a manual winding tourbillon movement with hours, minutes, power-reserve and function indicators. This edition has been unveiled in 2020 and produced in very few pieces. #RichardMille

Retail price: $ 1,304,500.00

Photo: @gettyimages | @richardmille
